t.add("answer.52", "Yes, simply <a href=\"https:\/\/awardwallet.com\/agents\/add\">add your family members&#39; names to your profile<\/a>, and then you can assign loyalty accounts to individual family members names. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/<\/a>", "faq", "zh_TW");
t.add("answer.53", "Yes, you can (and should) backup your passwords&nbsp;if you&nbsp;decided to store them locally. You can do that by selecting the accounts you wish to backup and then choose the &quot;Backup Passwords&quot; option from the &quot;Actions&quot; menu. &nbsp;For more details please check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/<\/a>", "faq", "zh_TW");
t.add("answer.56", "Yes, you can <a href=\"https:\/\/awardwallet.com\/agents\/add-connection\">link your accounts<\/a>, and then choose which accounts you wish to share with each other, and what level of access do you wish to provide. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/<\/a>", "faq", "zh_TW");
t.add("answer.68", "First of all, thank you! Second, yes we <a href=\"\/faqs#28\">have an affiliate program<\/a>, and all of our logos and screenshots and banners are always neatly organized on <a href=\"https:\/\/awardwallet.com\/media\/logos\">this page<\/a> which BTW, can always be accessed if you just right-click (option-click) on our logo at the top of any page. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/<\/a>", "faq", "zh_TW");
t.add("answer.70", "To delete one of the loyalty accounts from your AwardWallet profile you simply need to first&nbsp;select that account by clicking a checkbox next to it and then you will see a button with a trash bin in the menu, which, when clicked, will delete all accounts that are selected.<br \/>\n<br \/>\n<img alt=\"\" src=\"https:\/\/awardwallet.com\/images\/uploaded\/fck\/faq\/en\/70-1.png\" style=\"width: 650px; height: 383px;\" \/>", "faq", "zh_TW");
t.add("answer.71", "First, please double-check that you are entering the correct code. If you are 100% sure the code is correct then it could be a time sync issue. If the time on your laptop is 1:00&nbsp;pm and the time on your phone where you are generating the code is 1:03 pm, that would indicate a problem. In that case, you should <a href=\"https:\/\/www.google.com\/search?q=how+to+sync+clock+on+android\">get your&nbsp;phone clock synced<\/a> and then try again.", "faq", "zh_TW");
t.add("question.47", "I have a lot of loyalty accounts in my AwardWallet profile, is there a way for me to quickly see when each account was last updated?", "faq", "zh_TW");
t.add("question.48", "How do I know if the miles or points from my last trip have been posted to my account?", "faq", "zh_TW");
t.add("question.52", "I wish to track loyalty accounts for my whole family, can I do that?", "faq", "zh_TW");
t.add("question.53", "I choose to store some of my accounts passwords locally on my computer, is there a way to backup them up and then restore the passwords on the same of different computer?", "faq", "zh_TW");
t.add("question.56", "My husband has his own AwardWallet account, can we share our loyalty accounts using AwardWallet with each other?", "faq", "zh_TW");
t.add("question.68", "I am a blogger and I wish to write an article about AwardWallet, do you have an affiliate program and where can I grab your logos?", "faq", "zh_TW");
t.add("question.70", "I wish to delete one of the loyalty accounts from my AwardWallet profile, how do I do that?", "faq", "zh_TW");
t.add("question.71", "I set up two-factor authentication on my account, however, the code that it generates stopped working all of a sudden? What do I do?", "faq", "zh_TW");
t.add("answer.74", "Balance Watch monitors a loyalty account to alert you as soon as your balance changes. Points from American Express, Chase, Citi, Marriott, and Capital One don&#39;t always post instantly when you transfer them to partner loyalty programs.&nbsp;<br \/>\n<br \/>\nWhen you find award availability for a flight or hotel, transfer your points and then use this service to make sure you can confirm your reservation before the availability disappears. Once activated, AwardWallet will check your account frequently and send you a desktop, mobile, and email notification as soon as a change is detected.&nbsp;", "faq", "zh_TW");
t.add("question.74", "What are Balance Watch credits?", "faq", "zh_TW");
t.add("answer.75", "The AwardWallet <a href=\"https:\/\/awardwallet.com\/merchants\">Merchant Lookup Tool<\/a> allows users to search for merchants and identify how transactions with those merchants are coded for a credit card transaction. This is important to maximize earning the most amount of points you can with a specific credit card.<br \/>\n<br \/>\nSome of the most common bonus categories for credit card spend are grocery, gas, travel, and dining. However, not all merchant types are as easy to classify. To find out, simply search for the store in question in the Merchant Lookup Tool and it&nbsp;will display a list of confirmed credit cards that earn more than 1 point per dollar at that particular merchant.<br \/>\n<br \/>\nHere is a quick explainer video:<br \/>\n<div style=\"max-width:640px; width: 100%\">\n<div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/360577226\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div>\n<\/div>", "faq", "zh_TW");
t.add("question.75", "What is the AwardWallet Merchant Lookup Tool?", "faq", "zh_TW");
t.add("answer.76", "AwardWallet only uses your Gmail data to retrieve travel reservations and loyalty account statements for the purposes of making the AwardWallet&#39;s service work. AwardWallet&#39;s use of information received, and AwardWallet&#39;s transfer of information to any other app, from Google APIs will adhere to Google&#39;s Limited Use Requirements. In addition to that none of your personal data that you have stored in AwardWallet is ever transmitted to any third party without your prior explicit written consent.", "faq", "zh_TW");
t.add("question.76", "If I link my Google mailbox to AwardWallet, how does AwardWallet use the data that's in my mailbox?", "faq", "zh_TW");
